} 然后，我们定义了 Kinds 对应的结构体类型，CronJob 和 CronJobList。 CronJob 是我们的 root type，用来描述 CronJob Kind。和所有 Kubernetes 对象一样， 它包含 TypeMeta (用来定义 API version 和 Kind) 和 ObjectMeta (用来定义 name、namespace 和 labels等一些字段) CronJobList 包含了一个 CronJob 的切片，它是用来批量操作 Kind 的，比如 LIST 操作 通常，我们不会修改它们 -- 所有的修改都是在 Spec 和 Status 上进行的。 +kubebuilder:object:root 注释称为标记(marker)。 稍后我们还会看到更多它们，它们提供了一些元数据， 来告诉 controller-tools (我们的代码和 YAML 生成器) 一些额外的信息。 这个注释告诉 object 这是一种 Kind。 然后，object 生成器会为我们生成 runtime.Object 接口的实现， 这是所有 Kinds 必须实现的接口。 // +kubebuilder:object:root=true // CronJob is the Schema for the cronjobs API
type CronJob struct { metav1.TypeMeta `json:",inline"` metav1.ObjectMeta `json:"metadata,omitempty"` Spec CronJobSpec `json:"spec,omitempty"` Status CronJobStatus `json:"status,omitempty"`
