在 Kubernetes 中，我们有一些设计 API 的规范。比如：所有可序列化字段必须是camelCase(驼峰) 格式，所以我们使用 JSON 的 tags 去指定它们，当一个字段可以为空时，我们会用 omitempty tag 去标记它。 字段类型大多是原始数据类型，Numbers 类型比较特殊：处于兼容性的考虑，numbers 类型只接受三种数据类型：整形只能使用 int32 和 int64 声明, 小数只能使用 resource.Quantity 声明 我的天, Quantity 又是什么鬼 Quantity 是十进制数字的一种特殊表示法，具有明确固定的表示形式，使它们在计算机之间更易于移植。在Kubernetes中指定资源请求和Pod的限制时，您可能已经注意到它们。 从概念上讲，它们的工作方式类似于浮点数：它们具有有效位数，基数和指数。它们的可序列化和人类可读格式使用整数和后缀来指定值，这与我们描述计算机存储的方式非常相似。 例如，该值2m表示0.002十进制表示法。 2Ki 表示2048十进制，而2K表示2000十进制。如果要指定分数，请切换到一个后缀，该后缀使我们可以使用整数：2.5is 2500m。 支持两个基数：10和2（分别称为十进制和二进制）。十进制基数用“常规” SI后缀（例如 M和K）表示，而二进制基数用“ mebi”表示法（例如Mi 和Ki）指定。想想 megabytes vs mebibytes 。 我们还使用了另一种特殊类型：metav1.Time。它除了格式在 Kubernetes 中比较通用外，功能与 time.Time 完全相同。 顺便让我们看一下 CronJob object 的内容！ project/api/v1/cronjob_types.goApache License Licensed under the Apache License, Version 2.0 (the "License"); you may not use this file except in compliance with the License. You may obtain a copy of the License at http://www.apache.org/licenses/LICENSE-2.0 Unless required by applicable law or agreed to in writing, software distributed under the License is distributed on an "AS IS" BASIS, WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied. See the License for the specific language governing permissions and limitations under the License. Imports package v1 import ( batchv1beta1 "k8s.io/api/batch/v1beta1" corev1 "k8s.io/api/core/v1" metav1 "k8s.io/apimachinery/pkg/apis/meta/v1"
) // EDIT THIS FILE! THIS IS SCAFFOLDING FOR YOU TO OWN!
// NOTE: json tags are required. Any new fields you add must have json tags for the fields to be serialized. 首先，让我们看一下 spec，如我们之前说的，spec 表明 期望的状态 ，所以有关 controller 的任何 "inputs" 都在这里声明。 一个基本的 CronJob 需要以下功能： 一个 schedule(调度器) -- (CronJob 中的 "Cron") 用来运行 Job 的模板 -- (CronJob 中的 "Job") 为了让用户体现更好，我们也需要一些额外的功能： 一个截止时间（StartingDeadlineSeconds）, 如果错过了这个截止时间，Job 将会等到下一个调度时间点再被调度。 如果多个 Job 同时启动要怎么做（ConcurrencyPolicy）（等待？停掉最老的一个？还是同时运行？） 一个暂停(Suspend)功能，以防止 Job 在运行过程中出现什么错误。 限制历史 Job 的数量（SuccessfulJobsHistoryLimit） 请记住，因为 job 不会读取自己的状态，所以我们需要用一些方式去跟踪一个 job 是否运行， 我们可以用至少一个 old job 来完成这个功能。（不明白，回头再改） 我们会用几个标记 (// +comment) 去定义一些额外的数据，这些标记在 controller-tools 生成 CRD manifest 时会被使用。 稍后我们还将看到，controller-tools 还会使用 GoDoc 来为字段生成描述信息。 // CronJobSpec defines the desired state of CronJob
type CronJobSpec struct { // +kubebuilder:validation:MinLength=0 // The schedule in Cron format, see https://en.wikipedia.org/wiki/Cron. Schedule string `json:"schedule"` // +kubebuilder:validation:Minimum=0 // Optional deadline in seconds for starting the job if it misses scheduled // time for any reason. Missed jobs executions will be counted as failed ones. // +optional StartingDeadlineSeconds *int64 `json:"startingDeadlineSeconds,omitempty"` // Specifies how to treat concurrent executions of a Job. // Valid values are: // - "Allow" (default): allows CronJobs to run concurrently; // - "Forbid": forbids concurrent runs, skipping next run if previous run hasn't finished yet; // - "Replace": cancels currently running job and replaces it with a new one // +optional ConcurrencyPolicy ConcurrencyPolicy `json:"concurrencyPolicy,omitempty"` // This flag tells the controller to suspend subsequent executions, it does // not apply to already started executions. Defaults to false. // +optional Suspend *bool `json:"suspend,omitempty"` // Specifies the job that will be created when executing a CronJob. JobTemplate batchv1beta1.JobTemplateSpec `json:"jobTemplate"` // +kubebuilder:validation:Minimum=0 // The number of successful finished jobs to retain. // This is a pointer to distinguish between explicit zero and not specified. // +optional SuccessfulJobsHistoryLimit *int32 `json:"successfulJobsHistoryLimit,omitempty"` // +kubebuilder:validation:Minimum=0 // The number of failed finished jobs to retain. // This is a pointer to distinguish between explicit zero and not specified. // +optional FailedJobsHistoryLimit *int32 `json:"failedJobsHistoryLimit,omitempty"`
} 我们自定义了一个类型（ConcurrencyPolicy）来保存我们的并发策略。 它实际上只是一个字符串，但是这个类型名称提供了额外的说明， 我们还将验证附加到类型上,而不是字段上，从而使验证更易于重用。 // ConcurrencyPolicy describes how the job will be handled.
// Only one of the following concurrent policies may be specified.
// If none of the following policies is specified, the default one
// is AllowConcurrent.
// +kubebuilder:validation:Enum=Allow;Forbid;Replace
type ConcurrencyPolicy string const ( // AllowConcurrent allows CronJobs to run concurrently. AllowConcurrent ConcurrencyPolicy = "Allow" // ForbidConcurrent forbids concurrent runs, skipping next run if previous // hasn't finished yet. ForbidConcurrent ConcurrencyPolicy = "Forbid" // ReplaceConcurrent cancels currently running job and replaces it with a new one. ReplaceConcurrent ConcurrencyPolicy = "Replace"
) 下面，让我们设计 status,它用来存储观察到的状态。它包含我们希望用户或其他 controllers 能够获取的所有信息 我们将保留一份正在运行的 Job 列表，以及上一次成功运行 Job 的列表。 注意，如上所述，我们使用 metav1.Time 而不是 time.Time 来获得稳定的序列化。 // CronJobStatus defines the observed state of CronJob
type CronJobStatus struct { // INSERT ADDITIONAL STATUS FIELD - define observed state of cluster // Important: Run "make" to regenerate code after modifying this file // A list of pointers to currently running jobs. // +optional Active []corev1.ObjectReference `json:"active,omitempty"` // Information when was the last time the job was successfully scheduled. // +optional LastScheduleTime *metav1.Time `json:"lastScheduleTime,omitempty"`
} 最后我们只剩下了 CronJob 结构体，如之前说的，我们不需要修改改结构体的任何内容， 但是我们希望操作改 Kind 像操作 Kubernetes 内置资源一样，所以我们需要增加一个 mark +kubebuilder:subresource:status, 来声明一个status subresource, 关于 subresource 的更多信息可以参考 k8s 文档 // +kubebuilder:object:root=true
// +kubebuilder:subresource:status // CronJob is the Schema for the cronjobs API
type CronJob struct { Root Object Definitions metav1.TypeMeta `json:",inline"` metav1.ObjectMeta `json:"metadata,omitempty"` Spec CronJobSpec `json:"spec,omitempty"` Status CronJobStatus `json:"status,omitempty"`
} // +kubebuilder:object:root=true // CronJobList contains a list of CronJob
type CronJobList struct { metav1.TypeMeta `json:",inline"` metav1.ListMeta `json:"metadata,omitempty"` Items []CronJob `json:"items"`
} func init() { SchemeBuilder.Register(&CronJob{}, &CronJobList{})
} 现在，我们已经有了一个 API，然后我们需要编写一个 controller 来实现具体功能。

