Controllers 是 operator 和 Kubernetes 的核心组件。 controller 的职责是确保实际的状态（包括群集状态，以及潜在的外部状态，例如正在运行的 Kubelet 容器和云提供商的 loadbalancers）与给定 object 期望的状态相匹配。 每个 controller 专注于一个 root Kind，但也可以与其他 Kinds 进行交互。 这种努力达到期望状态的过程，我们称之为 reconciling(调和，使...一直)。 在 controller-runtime 库中，实现 Kind reconciling 的逻辑我们称为 Reconciler 。 reconciler 获取对象的名称并返回是否需要重试(例如: 发生错误或是一些周期性的 controllers，像 HorizontalPodAutoscale)。 emptycontroller.goApache License Licensed under the Apache License, Version 2.0 (the "License"); you may not use this file except in compliance with the License. You may obtain a copy of the License at http://www.apache.org/licenses/LICENSE-2.0 Unless required by applicable law or agreed to in writing, software distributed under the License is distributed on an "AS IS" BASIS, WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied. See the License for the specific language governing permissions and limitations under the License. 首先，我们会 import 一些标准库。和以前一样，我们需要 controller-runtime 库，client 包以及我们定义的有关 API 类型的软件包。 package controllers import ( "context" "github.com/go-logr/logr" "k8s.io/apimachinery/pkg/runtime" ctrl "sigs.k8s.io/controller-runtime" "sigs.k8s.io/controller-runtime/pkg/client" batchv1 "tutorial.kubebuilder.io/project/api/v1"
) 接下来，kubebuilder 为我们搭建了一个基本的 reconciler 结构体。 几乎每个 reconciler 都需要记录日志，并且需要能够获取对象，因此这个结构体是开箱即用的。 // CronJobReconciler reconciles a CronJob object
type CronJobReconciler struct { client.Client Log logr.Logger Scheme *runtime.Scheme
} 大多数 controllers 最终都会运行在 k8s 集群上，因此它们需要 RBAC 权限, 我们使用 controller-tools RBAC markers 指定了这些权限。 这是运行所需的最小权限。 随着我们添加更多功能，我们将会重新定义这些权限。 // +kubebuilder:rbac:groups=batch.tutorial.kubebuilder.io,resources=cronjobs,verbs=get;list;watch;create;update;patch;delete
